    return(
      <Fragment>
        <MenuAppBar />
        <Switch>
          <Route exact path="/" render={() => <Redirect to="/home" />} />
          <Route exact path="/home" component={Home} />
          <Route exact path="/login" component={LoginForm} />
        </Switch>
      </Fragment>
    )
  }

}

